    testCache.disable();
    testCache.disable();
    testCache.disable();
    testCache.disable();
  });

  it('Should clear the entire cache, when disable is called', (): void => {
    testCache.enable();
    testCache.add('userId', 'claim', true);
    testCache.disable();

    const cachedKeys = Object.keys(testCache['cache']);

