          claim2: {
            userHasClaim: false,
            lastCheckedAt: moment(),
          },
          claim3: {
            userHasClaim: false,
            lastCheckedAt: moment().subtract(61, 'seconds'),
          },
        },
      };

      testCache['cache'] = sampleCache;

      testCache.removeOutdatedEntries();

